## Proposed changes

Add histogramJsonMetric and nodeInfo to the interface "http://fe_host:http_port/metrics?type=json".

## HistogramJsonMetric case:

{
	"tags":
	{
		"metric":"doris_fe_query_latency_ms",
		"quantile":"0.75"

	},
	"unit":"ms",
	"value":0.0
},
